column3:
아니 뿌링클은 BHC 대표메뉴인데 왜 이렇게 맛이 없죠?
뿌링클만 한 열 지점 정도 돌아다니며 먹어봤는데 종로점 뿌링클이 제일 형편없었어요. 닭도 몇호짜리인지 손가락 크기로 자잘한 걸 보내시고;
뿌링클 맛이 지점마다 천차만별인건 익히 알고 있었지만 여기가 제일 맛 없네요

버거 하나 누락되고 제가 먼저 연락하기 전까지 연락도 없었어요...
바쁘신거 알지만 매장측 실수로 누락된거면 먼저 연락주셨어야죠..;
나중에 환불처리는 해주셨지만 기분이 좋지많은 않았네요.

배달은 1시간 넘게 걸렸고 쇼킹핫 순�맛� 누가 먹다남은거 준것마냥 양도 너무 적고 양념도 없네요..
치킨은 다 식어서 오고 ;;
맛은 그냥저냥합니다

